class Member_MetaView extends BaseView{
    public function show(){
        $oModule = new GS_Module($this->_aParams['business'],"Entity","resource","gets");
        $aResource = $oModule->run();
        $this->_oTemplate->assign("aResource",$aResource);
    }     
